declare type Token = string | number | boolean;

declare type OBJECT = {
    [key in string | number]: VALUE;
};
declare type VALUE = OBJECT | Array<VALUE> | string | boolean | number;
declare const parse: (input: Array<Token>) => Record<string, VALUE> | null;

declare const lex: (input: string) => Token[];

declare const _default: (input: string) => Record<string, VALUE> | null;

export { _default as default, lex, parse };
